        if old.triforce_piece != self.triforce_piece {
            list.push(format!("Triforce_Piece: {:+}", self.triforce_piece - old.triforce_piece));
        }
    // bitflags
        let n = self.cbits1.contains(flags::ContextBits1::CHILD);
